import React from 'react';
import Header from './Header'; // Assuming Header is in src/components
import Footer from './Footer';
import NeonBg from './images/NeonBg.jpg';

function Homepage() {
  return (
    <div className="h-screen relative">
      <Header />  
      <img
        src={NeonBg}
        alt="background"
        className="absolute inset-0 object-cover w-full h-full z-1" 
      />
      <div className="p-7 place-content-center min-h-screen text-white font-serif relative z-10 d-flex justify-content-between">  {/* Added display: flex and justify-content: space-between */}
        <div>
          <h1>Chhon</h1>
          <p className="text-3xl">OW Student</p>
        </div>
        <div>
          <h1>KimEag</h1>
          <Footer />
        </div>
      </div>
    </div>
  );
}

export default Homepage;
